import React from 'react'
// import '../MidPageWebDesign.css'

function AppDesignImages({ image }) {
    return (
        <div className='MidPage'>
            <img className='MidPage__Image' src={image} alt=""/>
        </div>
    )
}

export default AppDesignImages
